  return (
    <div className='notes'>
      <div className="addnotebtn btn">
        <img src={add} alt="Add" />
        <button>Add Note</button>
      </div>
      <div className="notes-list">
        <div className="note">
          
        </div>
      </div>
    </div>
  )
}

export default Notes
